function enviromentHelper_AddScreenWidthListener(n){n.invokeMethodAsync("OnEvent",JSON.stringify(window.innerWidth));window.addEventListener("resize",()=>{n.invokeMethodAsync("OnEvent",JSON.stringify(window.innerWidth))},{passive:!0})}function BlazorDownloadFileFromPath(n,t,i){if(document.body.classList.contains("MobileApp")){var r=window.location.origin,u=r+"/Download?link="+n+"&filename="+t+"&token="+i;location.href="AppDownload="+t+";"+u}else location.href="/Download?link="+n+"&filename="+t+"&token="+i}function enviromentHelper_MouseOverDiv(n){const t=document.getElementById(n);return t!=null&&t.parentNode.matches(":hover")?"true":"false"}function enviromentHelper_SmoothScrollToTop(){let n=document.getElementsByTagName("html")[0];n.scrollIntoView({behavior:"smooth"})}function enviromentHelper_clickElement(n){return $("#"+n).trigger("click"),!0}function environmentHelper_openDropdown(n){return $("#"+n).hasClass("show")||$("#"+n).dropdown("toggle"),!0}function enviromentHelper_CheckWidthOnStartup(){return JSON.stringify(window.innerWidth)}function enviromentHelper_scrollToBottom(n){const t=document.getElementById(n);isDevice?t.scrollIntoView({behavior:"smooth",block:"nearest",inline:"start",offset:"0px"}):t.scrollIntoView({behavior:"smooth",block:"nearest",inline:"start",offset:"20px"})}function enviromentHelper_SetPageTitle(n){document.title=n}function isDevice(){return/android|webos|iphone|ipad|ipod|blackberry|iemobile|opera mini|mobile/i.test(navigator.userAgent)}function enviromentHelper_GetHtml(n){return $("#"+n).html()}function searchbar_ToggleVisibility(n){$("#"+n).modal("toggle")}function navmenu_ToggleVisibility(){document.getElementsByClassName("close-menu")[0].click()}function getRootWidth(){return window.innerWidth}